import React from 'react';
// import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import Header from './Header';
import TaskList from './TaskList';
import * as Lists from './todoListData';

export default class App extends React.Component {

    render() {

        const dataLists = []; // array of objects (data from todo lists)

        // add objects from todoListData to array
        for (const key in Lists) {
            dataLists.push(Lists[key]);
        }

        // create component from data in 
        const taskLists = dataLists.map(list => <TaskList data={list.data} title={list.name} />)

        return (
            <div>
                <Header />
                <div className="bkgrnd">
                    {taskLists}
                </div>
            </div>
        )
    }
}
